import React from 'react';
import Navbar from '../components/Navbar';
import ProfileHeader from '../components/ProfileHeader'

function Home() {
    return (
        <div className="App">
            <header className="hero">
                <Navbar />

                <div className="page-title">
                    <div className="container">
                        <h1>My Profile</h1>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default Home;
